import React from 'react'

class App extends React.Component {
  constructor () {
    super()
    this.state = {
      toggle: true
    }
  }

  handleToggle () {
    this.setState(
      { state: !this.state.toggle }
    )
  }

  render () {
    return (
      <>
        <div>Toggle {this.state.val}</div>
        <button onClick={() => this.handleToggle()}>
        {this.state.toggle ? 'On' : ''}
        </button>
      </>
    )
  }
}

export default App
